window.bookSummaryJSON = "<p><b><i>She doesn’t belong to me.</i></b></p> <p>I am the illegitimate son, unwanted and despised.</p> <p>Ophelia Hart is the girl next door. I’ve watched her grow up. And rescued her countless times from my half-brother.</p> <p>I’ve been gone from her life for two years and when I run into her again, she’s no longer a girl.</p> <p>Only problem is, she’s wearing his ring on her finger.</p> <p>But there’s always been something between us. I’ve always been her protector. Especially when it comes to him. And that pull is stronger than ever.</p> <p>She no longer thinks me the hero of her story, though.</p> <p>But I know something she doesn’t. A secret from her past. And she’s in danger.</p> <p>She’ll fight me.</p> <p>I’ll fight for her.</p> <p>If she hates me for what I have to do, so be it.</p> <p>Because there is no way in hell I will let my half-brother have her.</p>"; 
